import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const step1 = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: step1 });
    screenshots.push(step1);

    // Wait for the main content area to be present
    await page.waitForSelector('#mainContent', { timeout: 5000 });

    // Try to find the "Electronics" category card by its text (category grid)
    // Use XPath to find a div with class 'category-card' and text containing 'Electronics'
    const [electronicsCard] = await page.$x("//div[contains(@class, 'category-card')][.//text()[contains(.,'Electronics')]]");
    if (!electronicsCard) {
      throw new Error("Electronics category card not found");
    }

    // Scroll into view and click the Electronics category card
    await electronicsCard.scrollIntoViewIfNeeded();
    await electronicsCard.click();

    // Wait for the category results to load (look for heading with text 'Electronics')
    await page.waitForSelector("h2", { timeout: 5000 });
    // Find the heading with text 'Electronics'
    const electronicsHeading = await page.$("h2:text('Electronics')");
    // Fallback: use XPath if :text() is not supported
    let headingText = "";
    if (electronicsHeading) {
      headingText = await electronicsHeading.textContent();
    } else {
      const [h2El] = await page.$x("//h2[contains(text(), 'Electronics')]");
      if (h2El) {
        headingText = await h2El.textContent();
      }
    }

    // Take screenshot after navigation
    const step2 = path.join(screenshotsDir, 'step_2_electronics_category.png');
    await page.screenshot({ path: step2 });
    screenshots.push(step2);

    // Extract product titles in the Electronics category
    const productTitles = await page.$$eval('.product-title', nodes =>
      nodes.map(n => n.textContent.trim())
    );

    return {
      success: true,
      action: "Navigated to Electronics category via category card and verified category page loaded",
      extractedData: {
        categoryHeading: headingText.trim(),
        productTitles
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
